fn main() {
    println!("{}", case("mjqjpqmgbljsphdztnvjfqwrcgsmlb"));
    println!("{}", case("bvwbjplbgvbhsrlpgdmjqwftvncz"));
    println!("{}", case("nppdvjthqldpwncqszvftbrmjlhg"));
    println!("{}", case("nznrnfrfntjfmvfwmzdfjlvtqnbhcprsg"));
    println!("{}", case("zcfzfwzzqfrljwzlrfnpqdbhtmscgvjw"));
    println!("{}", case(""));
}

fn case(input: &str) -> usize {
    let digits = 14;

    let input = input.as_bytes();
    let len = input.len() - (digits - 1);
    for i in 0..len {
        use std::collections::HashSet;
        let mut bytes = HashSet::new();

        let mut flag = true;
        for j in 0..digits {
            if bytes.contains(&input[i+j]) {
                flag = false;
            } else {
                bytes.insert(&input[i+j]);
            }
        }

        if flag {
            return i + digits;
        }
    }
    0
}
